class GeneratedLocalizationsDelegate extends LocalizationsDelegate<WidgetsLocalizations> {
  const GeneratedLocalizationsDelegate();

  List<Locale> get supportedLocales {
    return const <Locale>[

      const Locale("de", ""),
      const Locale("hi", ""),
      const Locale("fi", ""),
      const Locale("ru", ""),
      const Locale("sv", ""),
      const Locale("pt", ""),
      const Locale("en", ""),
      const Locale("hr", ""),
      const Locale("it", ""),
      const Locale("fr", ""),
      const Locale("es", ""),
      const Locale("zh", ""),
      const Locale("ar", ""),
      const Locale("en", "GB"),
      const Locale("pl", ""),
      const Locale("he", ""),
      const Locale("ro", ""),
      const Locale("nl", ""),
      const Locale("tr", ""),
      const Locale("sr", ""),

    ];
  }

  LocaleResolutionCallback resolution({Locale fallback}) {
    return (Locale locale, Iterable<Locale> supported) {
      final Locale languageLocale = new Locale(locale.languageCode, "");
      if (supported.contains(locale))
        return locale;
      else if (supported.contains(languageLocale))
        return languageLocale;
      else {
        final Locale fallbackLocale = fallback ?? supported.first;
        return fallbackLocale;
      }
    };
  }

  @override
  Future<WidgetsLocalizations> load(Locale locale) {
    final String lang = getLang(locale);
    switch (lang) {

      case "de":
        return new SynchronousFuture<WidgetsLocalizations>(const de());
      case "hi":
        return new SynchronousFuture<WidgetsLocalizations>(const hi());
      case "fi":
        return new SynchronousFuture<WidgetsLocalizations>(const fi());
      case "ru":
        return new SynchronousFuture<WidgetsLocalizations>(const ru());
      case "sv":
        return new SynchronousFuture<WidgetsLocalizations>(const sv());
      case "pt":
        return new SynchronousFuture<WidgetsLocalizations>(const pt());
      case "en":
        return new SynchronousFuture<WidgetsLocalizations>(const en());
      case "hr":
        return new SynchronousFuture<WidgetsLocalizations>(const hr());
      case "it":
        return new SynchronousFuture<WidgetsLocalizations>(const it());
      case "fr":
        return new SynchronousFuture<WidgetsLocalizations>(const fr());
      case "es":
        return new SynchronousFuture<WidgetsLocalizations>(const es());
      case "zh":
        return new SynchronousFuture<WidgetsLocalizations>(const zh());
      case "ar":
        return new SynchronousFuture<WidgetsLocalizations>(const ar());
      case "en_GB":
        return new SynchronousFuture<WidgetsLocalizations>(const en_GB());
      case "pl":
        return new SynchronousFuture<WidgetsLocalizations>(const pl());
      case "he":
        return new SynchronousFuture<WidgetsLocalizations>(const he());
      case "ro":
        return new SynchronousFuture<WidgetsLocalizations>(const ro());
      case "nl":
        return new SynchronousFuture<WidgetsLocalizations>(const nl());
      case "tr":
        return new SynchronousFuture<WidgetsLocalizations>(const tr());
      case "sr":
        return new SynchronousFuture<WidgetsLocalizations>(const sr());

      default:
        return new SynchronousFuture<WidgetsLocalizations>(const S());
    }
  }

  @override
  bool isSupported(Locale locale) => supportedLocales.contains(locale);

  @override
  bool shouldReload(GeneratedLocalizationsDelegate old) => false;
}

String getLang(Locale l) => l.countryCode != null && l.countryCode.isEmpty
    ? l.languageCode
    : l.toString();
